function hanja_hangul2hanja(targetChar){
	var tmp = new Array();
	var targetCode = targetChar.charCodeAt(0);
	var i=1;
	var j=0;
	while(i<hanja_dic.length){
		if(targetCode==hanja_dic[i]){
			tmp[j] = String.fromCharCode( hanja_dic[i-1] );
			j++;
		}
		i+=2;
	}
	return tmp;//array
}
function hanja_hanja2hangul(targetChar){
	var tmp = null;
	var targetCode = targetChar.charCodeAt(0);
	var i=0;
	while(i<hanja_dic.length){
		if(targetCode==hanja_dic[i]){
			tmp = String.fromCharCode(hanja_dic[i+1]);
			break;
		}
		i+=2;
	}
	return tmp;//string
}
