	var hangulIME_hanjabox = document.ime_form.hanjabox;
	function hanjabox_outputList( data ){
		if( (typeof( data )).search("bject") == -1 ){
			output = new Array(1);
			output[0] = data;
		}
		else output = data;
		hangulIME_hanjabox.value = '';
		var i;
		for(i=hangulIME_hanjabox.options.length;i>0;i=hangulIME_hanjabox.options.length) hangulIME_hanjabox.options[i-1] = null;
		for(i=0;i<output.length;i++){
			hangulIME_hanjabox.options[i]= new Option(output[i],output[i]);
		}
	}
	function hanja_hangulIME_convert(){
		var hangulString = selecter_fetch( hangulIME_textbox );
		var hanjaChar = hanja_hangul2hanja( hangulString );
		hanjabox_outputList( hanjaChar  );
	}


